window.jsData("e6a93d88-050e-4f3f-a7da-54a0cb5f56f3", [{"start":{"type":"kTopicStart","text":"// kTopicStart","params":{},"lineIndex":0},"content":"#include<stdio.h>\n\n/**\n * relational and logical operations\n */\nint main(int argc, char* argv[]) {\n    int a = 1, b = 2, c = 3, d = 3;\n\n    int ret1 = (a < b && b < c && c < d);\n    int ret2 = (a < b && b < c && c <= d);\n    int ret3 = ((a < b && b < c) || c < d);\n    printf(\"ret1:\\t%d\\n\", ret1);\n    printf(\"ret2:\\t%d\\n\", ret2);\n    printf(\"ret3:\\t%d\\n\", ret3);\n}\n","end":{"type":"kTopicEnd","text":"// kTopicEnd","params":{},"lineIndex":17},"description":"","format":"c","console":"ret1:\t0\nret2:\t1\nret3:\t1\n"}]);